import './new-task-form.css';

const NewTaskForm = () => {
   return (
    <header className="header">
       <h1>todos</h1>
       <form>
           <input className="new-todo"
                  placeholder="What needs to be done?"
                  autoFocus>
           </input>
       </form>
    </header>
   )
}

export default NewTaskForm;
